.landing {
  position: relative;
  width: 100%;
  height: 100vh;
  background: black;
  color: #ffffff;
  overflow: hidden;
  background-image: url("IMG_3604.ce380087.jpg");
  background-size: cover;
  background-repeat: no-repeat; }
  .landing .header {
    position: absolute;
    top: 1rem;
    left: 50%;
    transform: translateX(-50%);
    z-index: 2; }
    .landing .header__wrap {
      padding: 10px;
      display: flex;
      align-items: right;
      justify-content: right;
      width: 60vw; }
    .landing .header__left {
      display: flex;
      align-items: right;
      gap: 2rem; }
      .landing .header__left li {
        font-weight: 700;
        font-style: 18px; }
    @media (max-width: 1200px) {
      .landing .header__wrap {
        width: 100vw; } }
  .landing .socials {
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    bottom: 10rem;
    display: flex;
    align-items: center;
    gap: 1rem;
    z-index: 2; }
    .landing .socials__links {
      display: flex;
      align-items: right;
      gap: 2rem; }
      .landing .socials__links li {
        font-weight: 300;
        font-style: 8px; }
  .landing .scrollDown {
    position: absolute;
    bottom: 3rem;
    left: 50%;
    transform: translateX(-50%); }
    .landing .scrollDown__wheel {
      height: 42px;
      width: 24px;
      border-radius: 10px;
      border: 2px solid #000; }
      .landing .scrollDown__wheel--inner {
        position: absolute;
        left: 10px;
        margin-top: 5px;
        width: 4px;
        height: 4px;
        background: #000;
        border-radius: 50%;
        animation: movingwheel 0.5s linear infinite; }

@keyframes movingwheel {
  0% {
    top: 1px; }
  25% {
    top: 2px; }
  50% {
    top: 3px; }
  75% {
    top: 2px; }
  100% {
    top: 1px; } }
    .landing .scrollDown .scrollDown__arrows {
      display: flex;
      flex-direction: column;
      align-items: center; }
      .landing .scrollDown .scrollDown__arrows .scrollDown__arrow {
        width: 15px;
        height: 15px;
        border-right: 2px solid #000;
        border-bottom: 2px solid #000;
        transform: rotate(45deg);
        animation: scrollAnimation 1s infinite;
        animation-direction: alternate; }
        .landing .scrollDown .scrollDown__arrows .scrollDown__arrow:nth-child(1) {
          animation-delay: 0.1s; }
        .landing .scrollDown .scrollDown__arrows .scrollDown__arrow:nth-child(2) {
          animation-delay: 0.2s; }
        .landing .scrollDown .scrollDown__arrows .scrollDown__arrow:nth-child(3) {
          animation-delay: 0.3s; }

@keyframes scrollAnimation {
  0% {
    opacity: 0; }
  25% {
    opacity: 0.25; }
  50% {
    opacity: 0.5; }
  75% {
    opacity: 0.75; }
  100% {
    opacity: 1; } }
